"use strict";(self.webpackChunkisap_blog=self.webpackChunkisap_blog||[]).push([[808],{7872:a=>{a.exports=JSON.parse('{"blogPosts":[{"id":"el-nuevo-blog-del-padua","metadata":{"permalink":"/isap/blog/el-nuevo-blog-del-padua","source":"@site/blog/2023-12-11-frist-blog/index.md","title":"El nuevo blog del Padua","description":"Estamos emocionados de anunciar la inauguraci\xf3n de la flamante p\xe1gina de blogs del Padua. Esta nueva plataforma, impulsada por tecnolog\xedas de vanguardia como React y Webpack, presenta un dise\xf1o moderno y limpio que cautivar\xe1 tu atenci\xf3n. Todo esto ha sido posible gracias al proyecto de c\xf3digo abierto de Facebook, Docusaurus.","date":"2023-12-11T00:00:00.000Z","formattedDate":"11 de diciembre de 2023","tags":[{"label":"facebook","permalink":"/isap/blog/tags/facebook"},{"label":"docusaurus","permalink":"/isap/blog/tags/docusaurus"},{"label":"nuevo","permalink":"/isap/blog/tags/nuevo"},{"label":"2023","permalink":"/isap/blog/tags/2023"}],"readingTime":1.065,"hasTruncateMarker":true,"authors":[{"name":"Juan Manuel Menta","title":"Ex-Alumno del Padua @ 2023","url":"https://github.com/VeguiDev","imageURL":"https://vegui.dev/logo.png","key":"veguidev"}],"frontMatter":{"slug":"el-nuevo-blog-del-padua","title":"El nuevo blog del Padua","authors":["veguidev"],"tags":["facebook","docusaurus","nuevo","2023"]},"unlisted":false},"content":"Estamos emocionados de anunciar la inauguraci\xf3n de la flamante p\xe1gina de blogs del Padua. Esta nueva plataforma, impulsada por tecnolog\xedas de vanguardia como **React** y **Webpack**, presenta un dise\xf1o moderno y limpio que cautivar\xe1 tu atenci\xf3n. Todo esto ha sido posible gracias al proyecto de c\xf3digo abierto de Facebook, [Docusaurus](https://docusaurus.io/).\\n\\n\x3c!-- truncate --\x3e\\n\\n## Descubre un Mundo de Contenidos\\n\\nEn las pr\xf3ximas publicaciones, te sumergir\xe1s en un universo de recursos, noticias y trabajos realizados por nuestros talentosos alumnos. Estamos comprometidos a brindarte contenido valioso y relevante que te mantendr\xe1 informado y entretenido.\\n\\n## Tecnolog\xeda que Impulsa la Innovaci\xf3n\\n\\nLa elecci\xf3n de tecnolog\xedas de \xfaltima generaci\xf3n como React y Webpack garantiza una experiencia de usuario fluida y atractiva. Nos esforzamos por mantenernos a la vanguardia, ofreci\xe9ndote lo mejor en cuanto a dise\xf1o y funcionalidad.\\n\\n## Docusaurus: Nuestra Herramienta de Elecci\xf3n\\n\\nAprovechamos el poder de Docusaurus, una herramienta de c\xf3digo abierto desarrollada por Facebook, para dar vida a esta plataforma. Su flexibilidad y robustez nos permiten ofrecer una experiencia de navegaci\xf3n excepcional mientras compartimos contenido significativo contigo.\\n\\n\xa1\xdanete a Nosotros en esta Experiencia!\\n\\nExplora nuestra nueva p\xe1gina de blogs y mantente al tanto de las \xfaltimas novedades, proyectos y logros de nuestros estudiantes. \xa1Te damos la bienvenida a este emocionante viaje de descubrimiento y aprendizaje!"}]}')}}]);